column8:
9/14公開ユニバーサルスタジオ映画「怪盗グルーのミニオン危機一発」で大人気！おならブラスターです！<br><br>

トリガーを引くとおならの効果音が出たりライトの色が変わります。<br><br>

ジョークモード - 20秒後におならの音が出ます。 <br><br>

単四電池2つ使用します。 <br><br>
パーティやハロウィン、いたずらに最適！！<br><br>

※悪用は厳禁です（笑）</DIV>
